import { Component } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {

  public eventos: any = [
  {
    tema: '.Net',
    local: 'Rio de Janeiro'
  },
  {
    tema: 'Angular',
    local: 'São Paulo'
  },
  {
    tema: 'Angular 11',
    local: 'São Paulo'
  }

  ]
}
<h1>Eventos de Componets</h1>

<div>*ngFor="let eventos of evento"
<p>{{evento.tema}}</p>
<p>{{evento.local}}</p>
</div>
